export class Track {
    id: number = -1;
    number: number = 0;
    title: string = "";
    lyrics: string = "";
    video: string = "";

    constructor(id: number, number: number, title: string, lyrics: string, video: string) {
        this.id = id;
        this.number = number;
        this.title = title;
        this.lyrics = lyrics;
        this.video = video;
    }

    get Id(): number {
        return this.id;
    }
    set Id(id: number) {
        this.id = id;
    }

    get Number(): number {
        return this.number;
    }
    set Number(number: number) {
        this.number = number;
    }

    get Title(): string {
        return this.title;
    }
    set Title(title: string) {
        this.title = title;
    }

    get Lyrics(): string {
        return this.lyrics;
    }
    set Lyrics(lyrics: string) {
        this.lyrics = lyrics;
    }

    public get Video(): string {
        return this.video;
    }

    public set Video(value: string) {
        this.video = value;
    }
}
